const initState = {
    todoDescription: '',
    todoResponseble: '',
    todoPriority: '',
    todoCompleted: false
};

const createTodo = (state = initState, action) => {
    switch (action.type) {
        case 'changeTodoDescription':
            console.log(state.todoDescription);
            return {
                ...state,
                todoDescription: action.description,
            };
        case 'changeTodoResponsible':
            console.log(state.todoResponsible);
            return {
                ...state,
                todoResponsible: action.responsible,
            }
        case 'changeTodoPriority':
            console.log(state.todoPriority);
            return {
                 ...state,
                todoPriority: action.priority,
            }
        case 'submit':
            console.log(state.todoDescription);
            console.log(`Todo submoted: ${state.todoDescription}`);

            return state;
        default:
            return state;
    }
}

export default createTodo;
